type ActivitysProps = {
 type: number
}
const Activitys = (props: ActivitysProps) => {
 const { type } = props;
 return (
  <div className="detail">
   {
    type === 1 && <img src={one} alt="" />
   }
   {
    type === 2 && <img src={two} alt="" />
   }
   {
    type === 3 && <img src={three} alt="" />
   }
   {
    type === 4 && <img src={four} alt="" />
   }
  </div>
 )
}
export default Activitys;
